import React from "react";
import action from "./images/action.png";
import Drama from "./images/Drama.png";
import Romance from "./images/Romance.png";
import Thriller from "./images/Thriller.png";
import Western from "./images/Western.png";
import Horror from "./images/Horror.png";
import Fantasy from "./images/Fantasy.png";
import music from "./images/music.png";
import Fiction from "./images/Fiction.png";
import alert from "./images/alert.png";
import "./Onboarding.css";

const Onboarding = () => {
  return (
    <div className="board2">
      <h1 className="heading2">Super App</h1>
      <div className="block1">
        <h2 className="choose">Choose your Entertainment Category</h2>
      </div>
      <div className="block2">
        <div className="action-cover">
          <p className="Action">Action</p>
          <img className="action" src={action} alt="not found" />
        </div>
        <div className="drama-cover">
          <p className="Drama">Drama</p>
          <img className="drama" src={Drama} alt="not found" />
        </div>
        <div className="romance-cover">
          <p className="Romance">Romance</p>
          <img className="Romance" src={Romance} alt="" />
        </div>

        <div className="thiller-cover">
          <p className="thriller"></p>
          <img className="thriller" src={Thriller} alt="" />
        </div>
        <div className="western-cover">
          <p className="Western"></p>
        <img className="Western" src={Western} alt="" />
        </div>

        <div className="horror-cover"></div>
        <img className="Horror" src={Horror} alt="" />
        <img className="Fantasy" src={Fantasy} alt="" />
        <img className="music" src={music} alt="" />
        <img className="Fiction" src={Fiction} alt="" />
      </div>
      <img className="alert" src={alert} alt="" />
      <p className="Note">Minimum 3 Category Required</p>
      <button className="Next-page">Next Page</button>
    </div>
  );
};

export default Onboarding;
